import React from 'react'
import { Button } from '../Aboutus/Aboutus.elements';
import {SuperSubgrid2, Subheading, Head,Desc } from './Service.elements';
import {motion} from ''
function Component(props) {
    const descriptionMotion = {
        rest: {
          opacity:0,
            y: 30,
          transition: {
            duration: 0.4,
            type: "tween",
            ease: "easeOut"
          }
        },
        hover: {
         opacity:0.6,
          y: -15,
          transition: {
            duration: 0.4,
            type: "tween",
            ease: "easeIn"
          }
        }
      };
      
      const logoMotion = {
        rest: { opacity: 1,y:20, duration:0.8, type: "tween", ease: "easeIn" },
        hover: {
          opacity: 0,
          y:-30,
          transition: {
            duration: 0.4,
            type: "tween",
            ease: "easeIn"
          }
        }
      };
      const headingMotion = {
        rest: { opacity: 0.6,y:30, ease: "easeOut", duration: 0.2, type: "tween" },
        hover: {
          opacity: 1,
          y:-20,
          transition: {
            duration: 0.4,
            type: "tween",
            ease: "easeIn"
          }
        }
      };
    return (
       
                <SuperSubgrid2>
             {props.icon}
             <Head>{props.head}</Head>
             <Button>Learn More</Button>
             <Desc>{props.desc}</Desc>
                </SuperSubgrid2>

    )
}

export default Component
